(3509, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ နည်းပညာဖွံ့ဖြိုးရေးနှင့်မြှင့်တင်ရေးဌာနခွဲ၊ နည်းပညာဖွံ့ဖြိုးရေးဌာနစု', 30, NULL, NULL),
(3510, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ နည်းပညာဖွံ့ဖြိုးရေးနှင့်မြှင့်တင်ရေးဌာနခွဲ၊ နည်းပညာထောက်ပံ့ရေးဌာနစု', 30, NULL, NULL),
(3511, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ နည်းပညာဖွံ့ဖြိုးရေးနှင့်မြှင့်တင်ရေးဌာနခွဲ၊ နည်းပညာလွှဲပြောင်းရေးဌာနစု', 30, NULL, NULL),
(3512, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ နည်းပညာပူးပေါင်းဆောင်ရွက်ရေးဌာနခွဲ၊ အဖွဲ့အစည်းများနှင့်ဆက်သွယ်ရေးဌာနစု', 30, NULL, NULL),
(3513, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ နည်းပညာပူးပေါင်းဆောင်ရွက်ရေးဌာနခွဲ၊ နိုင်ငံခြားအဖွဲ့အစည်းများနှင့်နည်းပညာပူးပေါင်းဆောင်ရွက်', 30, NULL, NULL),
(3514, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ နည်းပညာပူးပေါင်းဆောင်ရွက်ရေးဌာနခွဲ၊ ပြည်တွင်းအဖွဲ့အစည်းများနှင့်နည်းပညာပူးပေါင်းဆောင်ရွက်', 30, NULL, NULL),
(3515, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ နိုင်ငံတကာဆက်ဆံရေးနှင့်ပူးပေါင်းဆောင်ရွက်မှုမြှင့်တင်ရေးဌာနခွဲ၊ နိုင်ငံတကာနှင့်နှစ်နိုင်ငံအဖွဲ့အစည်းများနှင့်ပူးပေါင်းဆောင်ရွက်မှုမြှင့်တင်ရေးဌာနစု', 30, NULL, NULL),
(3516, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ နိုင်ငံတကာဆက်ဆံရေးနှင့်ပူးပေါင်းဆောင်ရွက်မှုမြှင့်တင်ရေးဌာနခွဲ၊ ဒေသတွင်းအဖွဲ့အစည်းများနှင့်ပူးပေါင်းဆောင်ရွက်မှု', 30, NULL, NULL),
(3517, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ နိုင်ငံတကာဆက်ဆံရေးနှင့်ပူးပေါင်းဆောင်ရွက်မှုမြှင့်တင်ရေးဌာနခွဲ၊ ပညာရပ်ဆိုင်ရာနှင့်ဘာသာပြန်ဌာနစု', 30, NULL, NULL),
(3518, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ မူဝါဒ၊ မဟာဗျူဟာနှင့်လေ့လာဆန်းစစ်ရေးဌာနခွဲ၊ မူဝါဒရေးရာဌာနစု', 30, NULL, NULL),
(3519, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ မူဝါဒ၊ မဟာဗျူဟာနှင့်လေ့လာဆန်းစစ်ရေးဌာနခွဲ၊ မဟာဗျူဟာရေးရာဌာနစု', 30, NULL, NULL),
(3520, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ မူဝါဒ၊ မဟာဗျူဟာနှင့်လေ့လာဆန်းစစ်ရေးဌာနခွဲ၊ လေ့လာဆန်းစစ်ရေးဌာနစု', 30, NULL, NULL),
(3521, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ သတင်းအချက်အလက်နှင့်လူ့စွမ်းအားအရင်းအမြစ်ဖွံ့ဖြိုးရေး၊ သတင်းအချက်အလက်ဌာနစု', 30, NULL, NULL),
(3522, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ သတင်းအချက်အလက်နှင့်လူ့စွမ်းအားအရင်းအမြစ်ဖွံ့ဖြိုးရေး၊ လူ့စွမ်းအားအရင်းအမြစ်စီမံခန့်ခွဲရေးဌာနစု', 30, NULL, NULL),
(3523, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ သတင်းအချက်အလက်နှင့်လူ့စွမ်းအားအရင်းအမြစ်ဖွံ့ဖြိုးရေး၊ လေ့ကျင့်ရေးနှင့်ဖွံ့ဖြိုးရေးဌာနစု', 30, NULL, NULL),
(3524, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ သတင်းအချက်အလက်နှင့်လူ့စွမ်းအားအရင်းအမြစ်ဖွံ့ဖြိုးရေး၊ အလုပ်အကိုင်ရရှိမှုမြှင့်တင်ရေးနှင့်စုဆောင်းရွေးချယ်ရေးဌာနစု', 30, NULL, NULL),
