(3526, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ အင်ဂျင်နီယာဌာနခွဲ၊ အရည်အသွေးစစ်ဆေးရေးဌာနစု', 30, NULL, NULL),
(3527, 'နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီးဌာန၊ နည်းပညာမြှင့်တင်ရေးနှင့်ပူးပေါင်းဆောင်ရွက်ရေးဦးစီး(ရုံးချုပ်)၊ အင်ဂျင်နီယာဌာနခွဲ၊ ပြုပြင်ထိ်နးသိမ်းရေးဌာနစု', 30, NULL, NULL),
